$(function(){$(".slider__main").slick({arrows:!1,dots:!0,fade:!0,customPaging:function(s,i){$(s.$slides[i]).data();return++i<10?'<span class="dot-item">0'+i+"</span>":'<span class="dot-item">'+i+"</span>"}}),$(".reviews__carousel").slick({infinite:!0,slidesToShow:2,slidesToScroll:1,arrows:!0,prevArrow:'<div class="reviews__carousel-btn reviews__carousel-btn-left"></div>',nextArrow:'<div class="reviews__carousel-btn reviews__carousel-btn-right"></div>'}),$(".stages__slider-images").slick({slidesToShow:1,slidesToScroll:1,arrows:!1,dots:!1,fade:!0,asNavFor:".stages__slider-description"}),$(".stages__slider-description").slick({slidesToShow:1,slidesToScroll:1,asNavFor:".stages__slider-images",dots:!0,arrows:!1,fade:!0,focusOnSelect:!0}),$(".skills__item-inner").each(function(s,i){var e=$(i).data("skills");$(this).css("width",e+"%")}),$("#timer").countdown("2020/10/16",function(s){$(this).html(s.strftime('<div class="events__timer-item"><div class="events__timer-numb">%d</div><div class="events__timer-info">дней</div></div> <div class="events__timer-item"><div class="events__timer-numb">%H</div><div class="events__timer-info">часов</div></div> <div class="events__timer-item"><div class="events__timer-numb">%M</div><div class="events__timer-info">минут</div></div> <div class="events__timer-item"><div class="events__timer-numb">%S</div><div class="events__timer-info">секунд</div></div>'))}),$(".questions__list-title").click(function(){$(this).toggleClass("active"),$(this).next(".questions__list-text").slideToggle(300)})});